import { LibraryModel } from "./LibraryModel";

export class BookModel {
    public id: number;
    public name: string;
    public author: string;
    public year: number;
    public libraryId: number;
    public library: LibraryModel = LibraryModel.empty();

    constructor(
        id: number,
        name: string,
        author: string,
        year: number,
        libraryId: number,
        library: LibraryModel | undefined = undefined
    ) {
        this.id = id;
        this.name = name;
        this.author = author;
        this.year = year;
        this.libraryId = libraryId;
    }
}
